    "Pre-burn small mammal survey of the Yukon Flats National Wildlife Refuge: YFNWR
    project report number 86-3",nt"tracking_summary": {ntt"total": 2,ntt"recent":
    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2016-07-27T23:02:25.122394",nt"name": "pre-burn-small-mammal-survey-of-the-yukon-flats-national-wildlife-refuge-yfnwr-project-rep-5d806",nt"isopen":
    false,nt"url": null,nt"notes": "Yukon Flats National Wildlife Refuge has
    scheduled a prescribed burn for summer 1986 in an area known as The Buttes Gap.
    Reestablishing fire into the northern ecosystem can restore habitat and, therefore,
    animal diversity. The refuge is currently conducting studies to monitor wildlife
    responses before and after the prescribed burn. In conjunction with an ongoing furbearer
    survey, small mammals are being censused to establish species abundance and composition
    in various vegetation sites within the prescribed burn area. Trapping will continue
    for several years after the burn to determine how changes in small mammal populations
    relate to changes in post-fire plant communities. In Alaska, West (1979) surveyed
    small mammal populations after a forest fire but there have been no studies which
    examine populations both before and after fire in a specific area. This is the first
    report on the small mammals of The Buttes Gap prescribed burn site in Yukon Flats
    NWR.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
